var _ = require('lodash')

module.exports = /* @ngInject */ function() {
    var authConfig = {
        requireLogin: true,
        adminOrgs: {
            Administrative: {
                key: 'peoplenet',
                name: 'Peoplenet'
            }
        }
    }

    this.$get = function() {
        return _.cloneDeep(authConfig)
    }

    this.config = authConfig
}
